import React, {Component} from 'react';
import Bezitting from './Bezitting';

class Test extends Component {    
        state = {   
            items: [
            {
                id:1,
                bezitting: 'horloge',
                waarde: 300
            },
            {
                id:1,
                bezitting: 'auto',
                waarde: 18000
            },
            {
                id:1,
                bezitting: 'huis',
                waarde: 400000
            }
            ]
        }; 
    
    render() {    
        return(
            <Bezitting items={this.state.items}/>
        )
    }
}

export default Test
